window.bookSummaryJSON = "<p>Surviving in a tough situation is not always the best option; sometimes dying is much better than staying alive. The Academy showed Paladin Yaropolk what makes the world go round: pragmatism and personal gain. Restart was set in motion, but it only makes players more frantic. Now everyone plays only for themselves. Yaropolk faces the same dilemma: be like all of them, or keep his humanity and be known as an odd duck. Because there is only one rule in this world: kill or be killed.... </p>"; 
